import React from 'react'
import Navbar from './components/navbar/navbar';
import About from './pages/About';

export default class App extends React.Component{
  render(){
    switch(window.location.pathname){
      case "/":
        break
    }
    return(
      <div>
        <Navbar/>
        <About/>
      </div>
    )
  }
}
